import React from 'react';

const EverythingToolbar = ({ setViewMode, setFilter }) => {
  return (
    <div className="everything-toolbar">
      <button className="toolbar-button" onClick={() => setViewMode('list')}>List</button>
      <button className="toolbar-button" onClick={() => setViewMode('board')}>Board</button>
      <button className="toolbar-button" onClick={() => setViewMode('calendar')}>Calendar</button>
      <input 
        type="text" 
        placeholder="Search tasks..." 
        className="search-bar" 
        onChange={(e) => setFilter(e.target.value)} 
      />
    </div>
  );
};

export default EverythingToolbar;
